  display: inline-flex;
  align-items: center;

  background: transparent;
  border: 0;
  outline: none;

.ant-tabs-tab-remove:active {
  color: #096dd9;

  outline: none;
  transition: all 0.3s;
}
.ant-tabs-tab-remove {
  flex: none;
  margin-right: -4px;
  margin-left: 8px;
  color: rgba(0, 0, 0, 0.45);

  border: none;

  margin: 0;
}
.ant-tabs-tab .anticon {
  margin-right: 12px;
}
.ant-tabs-tab + .ant-tabs-tab {
  margin: 0 0 0 32px;

.ant-tabs-content {

  width: 100%;

.ant-tabs-content-holder {

.ant-tabs-tabpane {
  flex: none;
  width: 100%;
